import { Home } from "./pages/home";
import { Landing } from "./pages/landing";
import React, { useState } from "react";

export function App() {
  const [open, setOpen] = useState(false);
  const changePage = () => {
    setOpen(true);
  };
  return (
    <div>
      {open === false ? <Landing changePage={changePage} /> : ""}
      {open === true ? <Home /> : ""}
    </div>
  );
}
